<html>

<head>
<meta name="GENERATOR" content="Microsoft FrontPage 4.0">
<title>Image Cutter Output File</title>
<link rel="stylesheet" type="text/css" href="custom.css">
</head>

<body topmargin="0" bgcolor="#6767CD">
<div align="center">
  <center>
<table border="0" cellspacing="0" cellpadding="0" height="400" width="780">
  <tr>
    <td height="83" width="180"><img src="pageslice1.jpg" height="83" width="180" border="0"></td>
    <td height="83" width="45"><img src="pageslice2.jpg" height="83" width="45" border="0"></td>
    <td height="83" width="386" background="pageslice3.jpg" valign="middle" align="center">
      <p class="logoline">#LOGO#</p>
    </td>
    <td rowspan="2" height="121" width="169" valign="middle" align="center">#LOGOIMG#</td>
  </tr>
  <tr>
    <td height="38" width="180"><img src="pageslice5.jpg" height="38" width="180" border="0"></td>
    <td height="38" width="45"><img src="pageslice6.jpg" height="38" width="45" border="0"></td>
    <td height="38" width="386" background="pageslice7.jpg" valign="middle" align="center">
      <p class="sloganline">#SLOGAN#</p>
    </td>
  </tr>
  <tr>
    <td height="30" width="180"><img src="pageslice8.jpg" height="30" width="180" border="0"></td>
    <td colspan="3" height="30" width="600" background="pageslice9.jpg">#HMAINS#</td>
  </tr>
  <tr>
    <td height="249" width="180" background="pageslice10.jpg" valign="top" align="left" STYLE="background-repeat: no-repeat;">
      <div align="center">
        <table border="0" cellpadding="0" cellspacing="0" width="180">
          <tr>
            <td height="230" valign="bottom"><img border="0" src="userimages/_userimg-varphoto1.jpg" align="right" width="77" height="77"></td>
          </tr>
          <tr>
            <td>#VSUBS#</td>
          </tr>
          <tr>
            <td height="10"><img border="0" src="blank.gif" width="1" height="1"></td>
          </tr>
          <tr>
            <td>
              <p class="boxcontent1">#BOX1#</td>
          </tr>
        </table>
      </div>
    </td>
    <td colspan="3" height="249" width="600" background="pageslice11.jpg" valign="top" align="left" STYLE="background-repeat: no-repeat;">
      <div align="center">
        <table border="0" cellpadding="3" cellspacing="0" width="600">
          <tr>
            <td>
              <p class="sohotext">#CONTENT#</td>
          </tr>
        </table>
      </div>
    </td>
  </tr>
</table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780">
    <tr>
      <td valign="middle" align="center" height="21" bgcolor="#C9C8ED">
        <p class="SMtext"><font color="#000000">#COPYRIGHT#</font></td>
    </tr>
  </table>
  </center>
</div>
<p>#CUSTOMINC#</p>
</body>
</html>
